var silence_base64 = ""

if (window.location.href.indexOf('keepalive') > 0) {
    setTimeout(function () {
        try {
            var silence = new Audio("data:audio/wav;base64," + silence_base64); 
            silence.addEventListener('ended', function() {
                this.currentTime = 0;
                this.play();
            }, false);
            silence.play();
        }
        catch (e) {
            console.log(e);
        }
    }, 1000);
}